export const routes = [
    {
     path: "/",
     element: <Home />,
     errorElement: <ErrorPage />
    },
    {
     path: "/directors",
     element: <Directors />,
     errorElement: <ErrorPage />
    },
    {
     path: "/actors",
     element: <Actors />,
     errorElement: <ErrorPage />
    },
    {
     path: "/movie/:id",
     element: <Movie />,
     errorElement: <ErrorPage />
    },
    {
     path: "/bad-route",
     element: <ErrorPage/>,
     errorElement: <ErrorPage />
    }
   ];
